import React from "react";
import { Link } from "react-router-dom";
import './index.css';

const Navbar = () =>{
    return(<>
    <div className="navbar">

       <Link> About US </Link>
       <span/>
       <Link> Contact US </Link>
    </div>

    </>
)}

export default Navbar;
